import React from 'react';

const Burgers =({ burgers }) => {
  const renderBurgers = burgers.map(burger =>
    <span key={burger.id}>{burger.name}-</span>
    )

    return (
      <div className='menu'>
        {renderBurgers}
      </div>
    )
}

export default Burgers;
